"use strict";$(document).ready(function(){$('form[name="contact"]').on("submit",function(b){b.preventDefault();var a=$(this);$.ajax({type:"POST",data:a.serialize()+"&action=contact",processData:false,cache:false,dataType:"json",success:function(c){checkFormDataErrors(a,c,function(){$('[data-modal="success"] main > p').html(c.message);$('[data-modal="success"]').addClass("view");setTimeout(function(){location.reload()},1500)})}})})});